ntor, what to do?";}s:7:"content";a:2:{s:8:"rendered";s:673:"<p>If the buttons or other icons do not appear on Woolementor widgets after using Font Awesome then simply follow the steps below to fix this issue:</p>
<ol>
<li>Go to WordPress dashboard on the site&#8217;s backend.</li>
<li>Got to the settings of Elementor.</li>
<li>Click the advance tab and here you will find an option where it says- &#8220;Load Font Awesome Support&#8221;</li>
<li>Click &#8220;Yes&#8221; and save the settings.<br />
<img class="size-full wp-image-5463 aligncenter" src="http://help.codexpert.io/wp-content/uploads/2020/06/image.png" alt="" width="695" height="493" /></li>
</ol>
<p>That&#8217;s it! Now, you won&#8217;t face the issue anymore.</p>
