mentor and want to request for a refund, then you will need to deactivate the license key from the settings. Simply follow the steps below-</p>
<ol>
<li>Head over to Woolementor tab on your WordPress dashboard</li>
</ol>
<p><img class="aligncenter size-full wp-image-5406" src="http://help.codexpert.io/wp-content/uploads/2020/06/Woolementor.png" alt="" width="553" height="136" /></p>
<p>2. Click the license tab in settings</p>
<p><img class="aligncenter size-full wp-image-5407" src="http://help.codexpert.io/wp-content/uploads/2020/06/License.png" alt="" width="221" height="192" /></p>
<p>3. Then click the deactivate button. It will then remove your sites from our license server.</p>
<p><img class="aligncenter size-full wp-image-5408" src="http://help.codexpert.io/wp-content/uploads/2020/06/deactivate.png" alt="" width="1156" height="257" /></p>
<p>That&#8217;s it! As soon as the domains are removed from the license we will process the refund.</p>
