 new checkout page while keeping the current checkout page live?";}s:7:"content";a:2:{s:8:"rendered";s:586:"<p>Follow these steps to create a new checkout page while keeping the existing one live-</p>
<ol>
<li>Create a new page and start designing it with Elementor/Woolementor</li>
<li>Follow this post to configure the widgets/section properly <a href="http://help.codexpert.io/docs/woolementor/my-checkout-page-isnt-working" target="_blank" rel="noopener noreferrer">help.codexpert.io/docs/woolementor/my-checkout-page-isnt-working</a></li>
<li>When you are done with designing your new checkout page, go to the WooCommerce settings page and set the new checkout page as default.</li>
</ol>
